import React from "react";
import Header from "./components/Header";
import About from "./components/About";
import Footer from "./components/Footer";
import Portfolio from "./components/Portfolio";
import work from "./work";

function App() {
  return (
    <div>
      <Header />;
      <About />;
      <Portfolio />;
      <Footer />;
    </div>
  );
}

export default App;

